workflow.scratchpad.terraform_state_bucket = 'snow-terraform-state-files';

var item = new GlideRecord("sc_req_item");
var myJSON = {};
   item.addQuery("request",current.request);
   item.query();

   if (item.next()) {
// grab all variable sets from the parent request
     var var_own = new GlideRecord('sc_item_option_mtom');
     var_own.addQuery('request_item', item.sys_id);
     //var_own.addQuery('sc_item_option.item_option_new.u_approval_display', 'global');
     var_own.orderBy('sc_item_option.item_option_new.order');
     var_own.query();
     var jsonData = {};
     while (var_own.next()){
       var columnName = var_own.sc_item_option.item_option_new.name;
       jsonData[columnName] =    GlideEvaluator.evaluateString('item.variable_pool.'+var_own.sc_item_option.item_option_new.name+'.getDisplayValue()');
             //gs.print(var_own.sc_item_option.item_option_new.question_text + ": " + 
       }
     }

workflow.scratchpad.json_obj = JSON.stringify(jsonData);
